import React, {Component} from 'react'
import SignIn from './Sign-In'
import {BrowserRouter as Router, Route} from 'react-router-dom'

class App extends Component{

  render(){
    return(
      <div>
        <Router>
            <Route exact path="/" component={ SignIn }></Route>
        </Router>
      </div>
    )
  }

}

export default App;
